import React from 'react'
import { Route , Link } from 'react-router-dom';

class header extends React.Component {

    render() {

        const textStyles = {
            color: 'white',
            backgroundColor: 'black'
          }

        return (
            <div>
                <ul>
                    <Link to='/to' style={this.textStyles}>흐흐</Link>
                    <li style={this.textStyles}>{this.textStyles}</li>
                    <Link to='/about'>크크</Link>
                </ul>
            </div>
        )
    }
}

export default header;
